import React, {Component} from 'react';

class Info extends Component {
    render() {
        return(
            <div>
                <table>
                    <tr>
                        <th>Name</th>
                        <th>Amount</th>
                    </tr>
                </table>
            </div>
        );
    }
}

export default Info;
